	public function getList(Request $request){
		$query = self::$CreditNotes->where('status','!=',3);
		
		if($request->input('search_key')  && $request->input('search_key') != ""){
            $SearchKeyword = $request->input('search_key');
            $query->where(function($query) use ($SearchKeyword)  {
                if(!empty($SearchKeyword)) {
                    $query->where('name', 'like', '%'.$SearchKeyword.'%') 
                    ->orWhere('email', 'like', '%'.$SearchKeyword.'%')
                    ->orWhere('phone', 'like', '%'.$SearchKeyword.'%');
                }
             });
		}
		
		$users = $query->paginate(10);
		foreach($users as $key => $user){
			$billData = self::$Invoices->select('id','customer_name')->where('bill_no',$user->bill_no)->first();
			$user->customer_name = isset($billData->customer_name) ? $billData->customer_name : 'N/A';
			$user->created_date = date('m/d/Y',strtotime($user->created_at));
		}
		return response()->json(['success'=>true,'users'=>$users],200);
	}
	public function updateStatus(Request $request,$id,$status){
		$users = self::$CreditNotes->where('id',$id)->update(['status' => $status]);
		return response()->json(['success'=>true,'message'=>'Record deleted successfully'],200);
	}
	public function billGet(Request $request){
		$count = self::$CreditNotes->where('bill_no',$request->bill_no)->where('status',1)->count();
		if($count == 0){
			$billData = self::$Invoices->select('id','amount')->where('bill_no',$request->bill_no)->first();
			if(isset($billData->id)){
				return response()->json(['success'=>true,'bill_data'=>$billData],200);
			}else{
				return response()->json(['success'=>false,'message'=>'Invalid bill no'],200);
			}
		}else{
			return response()->json(['success'=>false, 'message' => 'Credit note already exist for this bill no.']);
		}
		
	}
	public function createCreditNote(Request $request){
		$validator = Validator::make($request->all(), [
			'bill_no' => 'required|numeric',
			'amount' => 'required|numeric'
			
		],[
			'bill_no.required' => 'Please enter bill no.',
			'amount.required' => 'Please enter amount.'
			
		]);
		if($validator->fails()){
			$errors = $validator->errors();
			if($errors->first('bill_no')){
				return response()->json(['success'=>false, 'message' => $errors->first('bill_no')]);
			}
			if($errors->first('amount')){
				return response()->json(['success'=>false, 'message' => $errors->first('amount')]);
			}
		}else{
			$count = self::$CreditNotes->where('bill_no',$request->bill_no)->where('status',1)->count();
			if($count == 0){
				$billData = self::$Invoices->select('id','amount')->where('bill_no',$request->bill_no)->first();
				if($request->amount <= $billData->amount){
					$setData = [
					'bill_no' => $request->bill_no,
					'amount' => $request->amount,
					'description' => $request->description,
					'date' => $request->date,
					'size' => $request->size,
					'from_address' => $request->from,
					'to_address' => $request->to,
					'added_by' => $GLOBALS['USER.ID'],
					'status' => 1
					];
					self::$CreditNotes->create($setData);
					return response()->json(['success'=>true, 'message' => 'Credit note created successfully']);
				}else{
					return response()->json(['success'=>false, 'message' => 'Amount cannot be grater thn invoice amount.']);
				}
			}else{
				return response()->json(['success'=>false, 'message' => 'Credit note already exist for this bill no.']);
			}
		}
	}
	public function convert_in_words($number){
		
		$no = round($number);
		$point = round($number - $no, 2) * 100;
		$hundred = null;
		$digits_1 = strlen($no);
		$i = 0;
		$str = array();
		$words = array('0' => '', '1' => 'one', '2' => 'two',
		 '3' => 'three', '4' => 'four', '5' => 'five', '6' => 'six',
		 '7' => 'seven', '8' => 'eight', '9' => 'nine',
		 '10' => 'ten', '11' => 'eleven', '12' => 'twelve',
		 '13' => 'thirteen', '14' => 'fourteen',
		 '15' => 'fifteen', '16' => 'sixteen', '17' => 'seventeen',
		 '18' => 'eighteen', '19' =>'nineteen', '20' => 'twenty',
		 '30' => 'thirty', '40' => 'forty', '50' => 'fifty',
		 '60' => 'sixty', '70' => 'seventy',
		 '80' => 'eighty', '90' => 'ninety');

		$digits = array('', 'hundred', 'thousand', 'lakh', 'crore');
		while ($i < $digits_1) {

		  $divider = ($i == 2) ? 10 : 100;
		  $number = floor($no % $divider);
		  $no = floor($no / $divider);
		  $i += ($divider == 10) ? 1 : 2;

		  if ($number) {
			 $plural = (($counter = count($str)) && $number > 9) ? null : null;
			 $hundred = ($counter == 1 && $str[0]) ? ' and ' : null;
			 $str [] = ($number < 21) ? $words[$number] .
				 " " . $digits[$counter] . $plural . " " . $hundred
				 :
				 $words[floor($number / 10) * 10]
				 . " " . $words[$number % 10] . " "
				 . $digits[$counter] . $plural . " " . $hundred;
		  } else $str[] = null;
	   }
	   $str = array_reverse($str);
	   $result = implode('', $str);
	   $points = ($point) ?
		 "." . $words[$point / 10] . " " .
			   $words[$point = $point % 10] : '';
		 //$result . "Rupees  " . $points . " Paise";
	   return ucwords($result);
 	}
